var memorize = function(f){
  var cache = {};
  return function(){
    var key = arguments.length + Array.prototype.join.call(arguments,',');
    if(key in cache){ 
      return cache[key]; 
    }
    else { 
      cache[key] = f.apply(this,arguments);
      return cache[key]; 
    }
  }
}

var gcd = function(a,b){
  var t = null;
  if(a < b){ t = a; a = b; b = t; }
  while(b !== 0) {
    t = b; b = a % b; a = t;
  }
  return a;
}
